import re

def extract_domain(url):
    """"""
    pattern = '(?:https?:\\/\\/)?(?:\\w+\\.)+(?:\\w+)(?=(?:\\/|\\?|$))'
    match = re.search(pattern, url)
    if match:
        domain = match.group(0)
        if domain.endswith('.com') and domain.count('.') >= 2:
            return domain
    return None
